import React from 'react';
import axios from 'axios';
import Listitem from './ListItem';
import ListContainer from './ListContainer'
//API https://www.googleapis.com/books/v1/volumes?q=quilting.
export default class App extends React.Component{
  constructor(props){
    super(props);
  this.state={ 
    AddIteme:[{id:1,nameBook:"Quilting For Dummies"}]
  }}
  addItem = (e) => {
    e.preventDefault();
    console.log('Add Item!');
    this.setState({
      toDoItems: [...this.state.toDoItems, this.state.newItem],
      newItem: ''
    });
  }
  onTextBoxChange = (e) => {
    console.log('On Text Change', e.target.value);
    this.setState({
      newItem: e.target.value
    });
  }
  render() {
    return (
      <div>
        <h1>Things I Should Start Doing:</h1>
        <ListContainer todoItems={this.state.toDoItems} />
        <hr />
        <form>
          <input type="text"
                 placeholder="Type an Item Here!"
                 value={this.state.newItem}
                 onChange={this.onTextBoxChange}
                 />
          <button onClick={this.addItem}>Add Item!</button>
        </form>
      </div>
    );
  }
}
